import React, { useState } from 'react';
import { Mail, Phone, MapPin, Send, Github, Linkedin, ExternalLink } from 'lucide-react';
import { personalInfo } from '../data/mock';
import { Button } from './ui/button';
import { Input } from './ui/input';
import { Textarea } from './ui/textarea';
import { useToast } from '../hooks/use-toast';

const Contact = () => {
  const { toast } = useToast();
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    // Simulate form submission
    await new Promise(resolve => setTimeout(resolve, 1000));

    toast({
      title: "Message Sent!",
      description: "Thank you for reaching out. I'll get back to you soon!",
    });

    setFormData({ name: '', email: '', subject: '', message: '' });
    setIsSubmitting(false);
  };

  const contactInfo = [
    {
      icon: Mail,
      label: 'Email',
      value: personalInfo.email,
      href: `mailto:${personalInfo.email}`
    },
    {
      icon: Phone,
      label: 'Phone',
      value: personalInfo.phone,
      href: `tel:${personalInfo.phone}`
    },
    {
      icon: MapPin,
      label: 'Location',
      value: personalInfo.location,
      href: null
    }
  ];

  const socialLinks = [
    {
      icon: Github,
      label: 'GitHub',
      href: personalInfo.github,
      username: '@Vishwa0611'
    },
    {
      icon: Linkedin,
      label: 'LinkedIn',
      href: personalInfo.linkedin,
      username: 'Ayush Vishwakarma'
    }
  ];

  return (
    <section id="contact" className="py-20 bg-cream-light">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section Title */}
        <div className="text-center mb-16">
          <h2 className="text-3xl sm:text-4xl font-bold text-charcoal mb-4">
            Get In <span className="text-charcoal-light">Touch</span>
          </h2>
          <div className="w-20 h-1 bg-charcoal mx-auto rounded-full"></div>
          <p className="mt-4 text-charcoal-light max-w-2xl mx-auto">
            I'm always open to discussing new opportunities, collaborations, or just having a chat about data!
          </p>
        </div>

        <div className="grid lg:grid-cols-2 gap-12">
          {/* Contact Info */}
          <div>
            <h3 className="text-2xl font-bold text-charcoal mb-8">Contact Information</h3>

            <div className="space-y-6 mb-10">
              {contactInfo.map((item, index) => (
                <div
                  key={index}
                  className="flex items-center gap-4 p-4 bg-cream rounded-2xl shadow-cartoon-sm hover:shadow-cartoon transition-all duration-300 hover:-translate-y-1"
                >
                  <div className="w-12 h-12 bg-charcoal rounded-xl flex items-center justify-center shadow-cartoon-sm">
                    <item.icon className="w-5 h-5 text-cream" />
                  </div>
                  <div>
                    <p className="text-sm text-charcoal-light font-medium">{item.label}</p>
                    {item.href ? (
                      <a
                        href={item.href}
                        className="text-charcoal font-semibold hover:text-charcoal-light transition-colors"
                      >
                        {item.value}
                      </a>
                    ) : (
                      <p className="text-charcoal font-semibold">{item.value}</p>
                    )}
                  </div>
                </div>
              ))}
            </div>

            {/* Social Links */}
            <h4 className="text-lg font-semibold text-charcoal mb-4">Connect With Me</h4>
            <div className="flex gap-4">
              {socialLinks.map((social, index) => (
                <a
                  key={index}
                  href={social.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="group flex items-center gap-3 p-4 bg-cream rounded-2xl shadow-cartoon-sm hover:shadow-cartoon hover:bg-charcoal transition-all duration-300 hover:-translate-y-1"
                >
                  <social.icon className="w-5 h-5 text-charcoal group-hover:text-cream transition-colors" />
                  <div>
                    <p className="text-xs text-charcoal-light group-hover:text-cream/70 transition-colors">
                      {social.label}
                    </p>
                    <p className="text-sm font-medium text-charcoal group-hover:text-cream transition-colors">
                      {social.username}
                    </p>
                  </div>
                  <ExternalLink className="w-4 h-4 text-charcoal-light group-hover:text-cream transition-colors" />
                </a>
              ))}
            </div>
          </div>

          {/* Contact Form */}
          <div className="bg-cream rounded-3xl p-8 shadow-cartoon">
            <h3 className="text-2xl font-bold text-charcoal mb-6">Send a Message</h3>

            <form onSubmit={handleSubmit} className="space-y-6">
              <div className="grid sm:grid-cols-2 gap-6">
                <div>
                  <label className="block text-sm font-medium text-charcoal mb-2">Name</label>
                  <Input
                    type="text"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                    placeholder="Your Name"
                    className="w-full rounded-xl border-2 border-charcoal/10 focus:border-charcoal bg-cream-light px-4 py-3"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-charcoal mb-2">Email</label>
                  <Input
                    type="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                    placeholder="your@email.com"
                    className="w-full rounded-xl border-2 border-charcoal/10 focus:border-charcoal bg-cream-light px-4 py-3"
                  />
                </div>
              </div>

              <div>
                <label className="block text-sm font-medium text-charcoal mb-2">Subject</label>
                <Input
                  type="text"
                  name="subject"
                  value={formData.subject}
                  onChange={handleChange}
                  required
                  placeholder="What's this about?"
                  className="w-full rounded-xl border-2 border-charcoal/10 focus:border-charcoal bg-cream-light px-4 py-3"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-charcoal mb-2">Message</label>
                <Textarea
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  required
                  placeholder="Your message here..."
                  rows={5}
                  className="w-full rounded-xl border-2 border-charcoal/10 focus:border-charcoal bg-cream-light px-4 py-3 resize-none"
                />
              </div>

              <Button
                type="submit"
                disabled={isSubmitting}
                className="w-full bg-charcoal hover:bg-charcoal-light text-cream rounded-full py-6 text-lg shadow-cartoon hover:shadow-cartoon-lg transition-all duration-300 hover:-translate-y-1 disabled:opacity-50 disabled:cursor-not-allowed"
              >
                {isSubmitting ? (
                  <span className="flex items-center justify-center">
                    <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-cream" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                      <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                      <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                    </svg>
                    Sending...
                  </span>
                ) : (
                  <span className="flex items-center justify-center">
                    <Send className="w-5 h-5 mr-2" />
                    Send Message
                  </span>
                )}
              </Button>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
